import React, { Component } from 'react';
import {Navbar, NavDropdown, Nav} from 'react-bootstrap';
import 'react-bootstrap';
import './Welcome.css';
import hackerman from './Images/hackerman2.jpg';
import logo from './Images/logoharmaa.png';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import Col from 'react-bootstrap/Col';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import './JoinForm.css';
import axios from 'axios';



class JoinForm extends Component {

  addRegistration(newReg){
    axios.request({
      method:'post',
      url:`http://localhost:8000/add/testi/${this.refs.regID.value}/${this.refs.first.value}/${this.refs.last.value}/${this.refs.age.value}/`,
      data: newReg
    }).then(response => {
      this.props.history.push('/Browse');
    }).catch(err => console.log(err));
  }
//talletetaan arvot ja annetaan ne addRegistrationille , jotta voidaan lähettää backendille
  onSubmit(e){
    const newReg = {
      id: this.refs.regID.value,
      first: this.refs.first.value,
      last: this.refs.last.value,
      age: this.refs.age.value

    }
    this.addRegistration(newReg);
    e.preventDefault();
  }



  render() {

    return (
        <div class ="FormStyle">
            <br></br>
<Form>
  <Form.Row>
    <Form.Group as={Col} controlId="formGridEmail">
      <Form.Label ><span>Etunimi</span></Form.Label>
      <Form.Control type="string" placeholder="Ville" />
    </Form.Group>

  </Form.Row>
  <Form.Row>

  <Form.Group as={Col} controlId="formGridPassword">
      <Form.Label>Sukunimi</Form.Label>
      <Form.Control type="string" placeholder="Kärkkänen" />
    </Form.Group>
    </Form.Row>


  <Form.Row>
    <Form.Group as={Col} controlId="formGridEmail">
      <Form.Label>Kotipaikkakunta</Form.Label>
      <Form.Control type="string" placeholder="Joensuu" />
    </Form.Group>
    </Form.Row>

    <Form.Row>

    <Form.Group as={Col} controlId="formGridPassword">
      <Form.Label>Sähköposti</Form.Label>
      <Form.Control type="email" placeholder="forssa@gmail.com" />
    </Form.Group>
  </Form.Row>

  <Form.Row>
  <Form.Group controlId="exampleForm.ControlSelect1">
    <Form.Label>Jäsentyyppi</Form.Label>
    <Form.Control as="select">
      <option>Opiskelijajäsen</option>
      <option>Kannatusjäsen</option>
      <option>Yhteisöjäsen</option>
    </Form.Control>




  </Form.Group>  
  </Form.Row>
    <Form.Row>


    <Form.Group as={Col} controlId="formGridEmail">
      <Form.Label>Opintojen aloitusvuosi</Form.Label>
      <Form.Control type="year" placeholder="2020" />
    </Form.Group>

</Form.Row>






  <Form.Group id="formGridCheckbox">
    <Form.Check type="checkbox" label="Haluan liittyä Skripti ry:n postituslistalle." />
  </Form.Group>
  <Form.Group id="formGridCheckbox">
    <Form.Check type="checkbox" label="Hyväksyn jäsenrekisterin ehdot ja vakuutan tietoni oikeiksi * " />
  </Form.Group>



  <Button variant="primary" type="submit" onSubmit={this.handleSubmit}>
    Submit
  </Button>
</Form>
<br></br>

</div>);

  }
}


export default JoinForm;
